import { useEffect, useState } from 'react';
import { db } from './firebase';
import { collection, query, where, getDocs, onSnapshot } from 'firebase/firestore';

export default function Dashboard({ onNovoContrato }) {
  const [totalVendasMes, setTotalVendasMes] = useState(0);
  const [contratosAtivos, setContratosAtivos] = useState(0);
  const [totalComissoes, setTotalComissoes] = useState(0);
  const [totalPlataformas, setTotalPlataformas] = useState(0);
  const [totalElevadores, setTotalElevadores] = useState(0);

  useEffect(() => {
    // Atualizar em tempo real
    const contratosRef = collection(db, 'contratos');

    const unsubscribe = onSnapshot(contratosRef, (snapshot) => {
      let vendasMes = 0;
      let ativos = 0;
      let comissoes = 0;
      let plataformas = 0;
      let elevadores = 0;

      const now = new Date();
      const mesAtual = now.getMonth() + 1;
      const anoAtual = now.getFullYear();

      snapshot.docs.forEach(doc => {
        const c = doc.data();

        // Somar valorGlobal no mês atual pelo campo 'inicio' (string 'YYYY-MM-DD')
        if (c.inicio) {
          const inicioDate = new Date(c.inicio);
          if (inicioDate.getMonth() + 1 === mesAtual && inicioDate.getFullYear() === anoAtual) {
            vendasMes += Number(c.valorGlobal) || 0;
          }
        }

        // Contratos ativos (data encerramento >= hoje ou vazio)
        if (!c.encerramento || new Date(c.encerramento) >= now) {
          ativos++;
        }

        comissoes += Number(c.valorComissao) || 0;
        plataformas += Number(c.qtdPlataformas) || 0;
        elevadores += Number(c.qtdElevadores) || 0;
      });

      setTotalVendasMes(vendasMes);
      setContratosAtivos(ativos);
      setTotalComissoes(comissoes);
      setTotalPlataformas(plataformas);
      setTotalElevadores(elevadores);
    });

    return () => unsubscribe();
  }, []);

  const cardClass =
    'bg-gray-800 text-white rounded-xl p-4 shadow-md flex flex-col justify-between';

  const valorFormatado = (valor, isCurrency = true) =>
    isCurrency
      ? valor.toLocaleString('pt-BR', { style: 'currency', currency: 'BRL' })
      : valor;

  return (
    <div className="max-w-7xl mx-auto mb-6">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold">Gestão dos Contratos</h1>
        <button
          onClick={onNovoContrato}
          className="bg-green-600 hover:bg-green-700 text-white font-semibold py-2 px-4 rounded-xl"
        >
          Novo Contrato
        </button>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-5 gap-4">
        <div className={cardClass}>
          <span className="text-gray-300">Total de Vendas no Mês</span>
          <span className="text-2xl font-bold">{valorFormatado(totalVendasMes)}</span>
        </div>

        <div className={cardClass}>
          <span className="text-gray-300">Contratos Ativos</span>
          <span className="text-2xl font-bold">{valorFormatado(contratosAtivos, false)}</span>
        </div>

        <div className={cardClass}>
          <span className="text-gray-300">Comissões Totais</span>
          <span className="text-2xl font-bold">{valorFormatado(totalComissoes)}</span>
        </div>

        <div className={cardClass}>
          <span className="text-gray-300">Total de Plataformas</span>
          <span className="text-2xl font-bold">{valorFormatado(totalPlataformas, false)}</span>
        </div>

        <div className={cardClass}>
          <span className="text-gray-300">Total de Elevadores</span>
          <span className="text-2xl font-bold">{valorFormatado(totalElevadores, false)}</span>
        </div>
      </div>
    </div>
  );
}
